import './index.scss';
import Navbar from '../Navbar';
import Last from '../../assets/fast-forward.png';
import Skip from '../../assets/skip-track.png';
import { io } from 'socket.io-client';

const socket = io();
socket.on('alert', (msg) => {
    alert(msg);
});

const test = 'https://media.discordapp.net/attachments/384897791291424789/1082511241727184897/CH20_031_save.png?width=439&height=621';
const Homepage = () => {
    return (
        <div className={ 'home' }>
            <Navbar />
            <div id={ 'wrapper' }>
                 <section id={ 'buttons' }>
                    <div id={ 'b-left' }>
                        <a id={ 'first' }><img src={ Last }></img></a>
                        <a id={ 'back' }><img src={ Skip }></img></a>
                    </div>
                    <div id={ 'b-right' }>
                        <a id={ 'forward' }><img src={ Skip }></img></a>
                        <a id={ 'last' }><img src={ Last }></img></a>
                    </div>
                </section>

                <section id={ 'recent' }>
                    <img src={ test }></img>
                </section>

                <section id={ 'authornotes' }>
                    <h3>A/N: </h3>
                </section>

                <section id={ 'comments' }>

                </section>
            </div>
        </div>
    );
}

export default Homepage;
